import React from "react";

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = { handleClick: 0 };

        this.handleClick = this.handleClick.bind(this)
    }

    handleClick(event) {
        console.log(event.target.value);
    }

    render() {
        return (
            <div>
                <h2 className="text-center text-white">Logget inn som: <b>[Username]</b></h2>
                <br></br>
                <div className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="p-2">
                        <button onClick={this.handleClick(props)} type="button" value="register" className="home-button btn btn-primary btn-lg">Ny melding</button>;
                    </div>
                    <div className="p-2">
                        <button type="button" className="home-button btn btn-primary btn-lg">Aktive meldinger</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
